import { useState } from "react";

const App = () => {
  return (
    <div>
      <Student name={"Djarot Purnomo"} isStudent={true} />
    </div>
  );
};

function Student({ name, isStudent }) {
  return (
    <div>
      <p>{name}</p>
      <p>{isStudent}</p>
    </div>
  )
}

export default App;
export { Student };
